void store_operand_ft(char* txt) {
  char c;
  unsigned int i;
  noperands_ft++;

  COUNT();

  c=txt[0];
  for (i=0;i<operands_ft[c].size();i++) {
    if (!strcmp(txt,operands_ft[c][i])) return;
  }
  operands_ft[c].push_back(txt);
}
